  # External references (assuming they are linked via a property ex:externalReference to a resource that provides alc and mpc endpoints)
  OPTIONAL {
    ?property ex:externalReference ?extRef .
    ?extRef ex:alcEndpoint ?alcEndpoint ;
            ex:mpcEndpoint ?mpcEndpoint .
  }
}
ORDER BY ?property

